import { connect } from "react-redux";


const formTrip = [
    {
      name: "username",
      type: "text",
      label: "Nome:",
      required: false,
      pattern: "[A-Za-z]{3,}"
    },
    {
      name: "age",
      type: "number",
      label: "Idade: ",
      required: true,
      minValue: 18,
    },
    {
      name: "aplicationText",
      type: "text",
      label: "Sou bom candidato por: ",
      required: true,
      minValue: 30
    },
    {
      name: "profession",
      type: "text",
      label: "Profissão",
      required: true,
      minValue: 10
    },
  ];




class CreateTrip extends Component {

    render(){
    return (
        <div>create trip</div>
    );
  }
}
 
  export default connect(null, null)(CreateTrip);
